    false,nt"url": null,nt"notes": "This narrative report for Mud Lake National
    Wildlife Refuge outlines Refuge accomplishments from 1938. The report begins by
    summarizing the weather conditions, water conditions, food and cover, and wildfires
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, fur animals, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include grazing, haying, fur harvesting, and timber removal. A progress report on
    field investigations and applied research is also provided. The public relations
    section discusses Refuge visitors, Refuge participation, and violations. Items of
    interest, N-R forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
